    render(){
        return(
           <div className='fondo'>
               <ul>
                    <li>
                        <button href='' onClick={this.handleClick('Hombre')}>Hombre</button>
                   </li>
                   <li>
                        <button href='' onClick={this.handleClick('Mujer')} >Mujer</button>
                   </li>
               </ul>
               <style jsx>
                   {`
                        .fondo{
                            box-shadow: 0px 0px 0px 3px;
